In addition to the higher k coefficient in the CoCrFeNiMn-1(at.%)C, the friction stress (σ

                           0
                        ) value of 288.15 MPa is also higher than that reported for the CoCrFeNiMn alloy –125 MPa [18]. The increase of friction stress can possibly be attributed to solid solution strengthening effect caused by carbon. Indeed, the CoCrFeNiMn-1(at.%)C alloy contains ≈1 at.% (or ≈0.2 wt%) of carbon in solid solution. Linear dependence between the carbon concentration and the yield strength has been established for different austenitic steels and it was found that the yield strength increases by 76.6 MPa per 1 at.% of carbon in stainless steels [59] and by 42 MPa/at% C in TWIP steels [60]. However, the difference between the friction stresses of the CoCrFeNiMn-1(at.%)C and CoCrFeNiMn alloys is much higher - ≈160 MPa. Probably, complex stress fields around each atom in the fcc lattice of the CoCrFeNiMn-based alloys due to the differences in atomic sizes and shear modulus of the composing elements may increase the strengthening effect of carbon in comparison with more dilute steels. The developed theoretical approaches for solid solution strengthening in HEAs account only for substitutional solid solutions [38,61,62] and therefore it difficult to make any calculation to prove this assumption. However, the previously reported data on CoCrFeNiMn-0.5 (at.%) C and Fe40·4Ni11·3Mn34·8Al7·5Cr6-1.1 (at.%) C alloys [45,46] confirm strong solid solution strengthening effect of C. In the CoCrFeNiMn-0.5 (at.%) C alloy, the yield strength increases by ≈ 120 MPa/at% C, while in the Fe40·4Ni11·3Mn34·8Al7·5Cr6-1.1 (at.%) C the increase of yield strength is 178 MPa/at%C. These values are reasonably close to the increase of friction stress of the CoCrFeNiMn alloy due to alloying with 1 at.% of carbon found in current study - ≈160 MPa/at% C, taking into account the experimental uncertainties. Thus the increase in friction stress in equation (3) in the carbon-containing CoCrFeNiMn-1(at.%)C alloy in comparison with “pure” CoCrFeNiMn can be attributed to solid solution strengthening.
